import React from 'react';
import { useGLTF } from '@react-three/drei';

export default function MyModel({ scale = 1, position = [0, 0, 0], rotation = [0, 0, 0] }) {
  // Load the GLB model
  const { scene } = useGLTF('/Users/sayurigarud/Desktop/fashionImageRec/src/assets/girl_frontend.glb'); // Update the path to your model file

  return (
    <primitive
      object={scene}
      scale={scale}
      position={position}
      rotation={rotation}
    />
  );
}

// Preload the model for performance
useGLTF.preload('/Users/sayurigarud/Desktop/fashionImageRec/src/assets/girl_frontend.glb');
